import React from 'react';

const Overlay = () => {
  return <div></div>;
};

const MenuIcon = () => {
  return (
    <div>
      <div style={{ cursor: 'pointer' }}></div>
      <div></div>
      <div style={{ cursor: 'pointer' }}></div>
    </div>
  );
};

const MenuBar = () => {
  return (
    <div>
      <Overlay />
      <MenuIcon />
    </div>
  );
};

const Home = () => {
  return (
    <div>
      <MenuBar />
      <div id='menu' class='hidden'>
        <div>
          <a href='catalog.html'>Catalog</a>
        </div>
        <div>
          <a href='pricing.html'>Pricing</a>
        </div>
      </div>
      <div id='login-bar'>
        <a href='login.html'>
          <button>Sign in</button>
        </a>
        <a href='start.html'>
          <button>Start free trial</button>
        </a>
      </div>
      <script src='../animations.js'></script>
    </div>
  );
};

export default Home;
